select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1578771083,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.6 Changelog",content="TSM v4.9.6 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added check when changing the craft value method that it doesn't include &#8220;crafting&#8221;<br />* Fixed error when importing very old TSM settings<br />* Fixed issue with incorrect last scan time<br />* [Classic] Fixed error when starting a manual scan when one is already in progress<br />* [Classic] Fixed issue with disenchant value for some items<br />* [Classic] The manual scan popup now allows for immediately starting a scan<br />* [8.3] Fixed issue with bid and buyout price when posting multiple of an item<br />* [8.3] Showing the total purchase price in the popup for commodities<br />* [8.3] Fixed max post quantity for non-commodity items<br />* [8.3] Added workaround for Blizzard bug preventing searching for some items<br />* [8.3] Added &#8220;/upgrades&#8221; and &#8220;/uncollected&#8221; search terms<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578588453,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-6-changelog/"},{title="TradeSkillMaster v4.9.5 Changelog",content="TSM v4.9.5 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with the number of &#8220;Posts&#8221; displayed from a scan being inflated<br />* [8.3] Fixed issue with the &#8220;Qty&#8221; column in auction tables being inaccurate in some situations<br />* [8.3] Fixed issue with the available purchase quantity being inaccurate in some situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578244028,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-5-changelog/"},{title="TradeSkillMaster v4.9.4 Changelog",content="TSM v4.9.4 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with buying auctions via Sniper<br />* [8.3] Fixed issue with Sniper freezing the game when there are large number of items in groups<br />* [Classic] Fixed issue with vendor search and disenchant search not finding auctions in certain situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578200887,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-4-changelog/"},{title="TradeSkillMaster v4.9.3 Changelog",content="TSM v4.9.3 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed some issues with bidding and buying via Shopping / Sniper<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578193090,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-3-changelog/"},{title="TradeSkillMaster v4.9.2 Changelog",content="TSM v4.9.2 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error when bidding on or buying auctions through Sniper<br />* Hiding auctions which can't be bid on from Bid Sniper<br />* Fixed issue causing scanning to be slow in some situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578191784,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-2-changelog/"},{title="TradeSkillMaster v4.9.1 Changelog",content="TSM v4.9.1 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed error when opening the My Auctions tab of the AH with pending sold auctions<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578186508,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-1-changelog/"},{title="TradeSkillMaster v4.9 Changelog",content="TSM v4.9 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Updated TSM to support patch 8.3](https://blog.tradeskillmaster.com/tsm-addon-changes-for-patch-8-3/)<br />* Fixed bug with &#8220;/tsm restock_help&#8221; not displaying in the correct chat tab and incorrectly blaming restock quantities<br />* Fixed &#8220;script ran too long&#8221; error while in combat<br />* Significantly optimized how TSM internally evaluates custom prices to improve the performance of large scans<br />* Fixed error when the game is closed during a loading screen<br />* Minor UI tweaks to the Banking UI<br />* Sniper will now properly show a confirmation window when configured to do so<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578184080,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-changelog/"},{title="TSM Addon Changes for Patch 8.3",content="The first update to TradeSkillMaster in 2020 will be a considerable adaptation to the upcoming Auction House changes planned in Patch 8.3. If you haven't heard about the in-game AH overhaul, or would like a reminder of the details, head over to the Wowhead preview post here. The TSM Team have been primarily focusing getting [...]",timestamp=1578178535,link="https://blog.tradeskillmaster.com/tsm-addon-changes-for-patch-8-3/"},{title="TradeSkillMaster v4.8.24 Changelog",content="TSM v4.8.24 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with TSM blocking various game functions<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1576367296,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-24-changelog/"},{title="TradeSkillMaster v4.8.23 Changelog",content="TSM v4.8.23 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error during custom posting.<br />* Fixed error with variation items not getting tagged with the proper mail type.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1576095515,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-23-changelog/"}}}]]) --<APP_INFO,Global,1578771083>
